import React from "react";
import "./SideBarChat.css";
import { Avatar } from "@material-ui/core";

const Chats = () => {
  return (
    <div className="sidebar__chat">
      <Avatar />
      <div className="sidebarChat__info"></div>
    </div>
  );
};

export default Chats;
